import React from 'react';
import Autorization from './Authorization';
import { connect } from 'react-redux';

class Authrization extends React.PureComponent {
  render() {
    return (
      <div>
        <form>
          <p>Email: </p>
          <input type="text" />
          <p>Password: </p>
          <input type="text" />
          <button type="submit">Login</button>
        </form>
      </div>
    );
  }
}

function mapDispatchToProps(dispatch) {
  return {
    onAuth: (email, password) => dispatch(Authentication(email, password)),
  };
}

export default connect(null, null)(Authrization);
